import React, { Component } from "react";
import Firstunit from './firstInput'
import Secoundunit from './secoundInput'

export default class unittype extends Component {
  state = {
    unit: ""
  };
  getUnit = event => {
    this.setState({ unit: event.target.value });
  };
  render() {
    return (
      <div>
        <select id="SelectUnit" onChange={this.getUnit}>
          <option value="1">LENGTH</option>
          <option value="2">MASS</option>
          <option value="2">VLOUME</option>
          <option value="TEMP">TEMERATURE</option>
        </select>
        <Firstunit unit={this.state.unit} />
        <Secoundunit unit={this.state.unit} />
      </div>
    );
  }
}
